import React from "react";
import { useParams, useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import "../Css/TrackOrder.css";

function TrackOrder() {
  const { orderId } = useParams();
  const navigate = useNavigate();

  // Load orders from localStorage
  const orders = JSON.parse(localStorage.getItem("orders")) || [];

  // Find matching order
  const order = orders.find((o) => o.orderId === orderId);

  return (
    <>
      <Navbar />

      <div className="track-container">
        {!order ? (
          /* ================= ORDER NOT FOUND ================= */
          <div className="track-empty">
            <h2>Order Not Found</h2>
            <p>Please check your Order ID or try again.</p>

            <button
              className="track-btn primary"
              onClick={() => navigate("/dashboard")}
            >
              Go Home
            </button>
          </div>
        ) : (
          /* ================= ORDER DETAILS ================= */
          <div className="track-card">
            <h2 className="track-title">Track Order</h2>
            <p className="track-sub">
              View your order details and current status
            </p>

            {/* ORDER INFO */}
            <div className="track-info">
              <div>
                <b>Order ID:</b> {order.orderId}
              </div>
              <div>
                <b>Order Date:</b>{" "}
                {new Date(order.date).toLocaleString()}
              </div>
              <div>
                <b>Status:</b>{" "}
                <span className="status-badge">{order.status}</span>
              </div>
              <div>
                <b>Payment:</b>{" "}
                {order.payment?.toUpperCase() || "COD"}
              </div>
            </div>

            <hr className="track-divider" />

            {/* ITEMS */}
            <h3 className="items-title">Items</h3>

            {order.items.map((item) => (
              <div className="track-item" key={item.cropId}>
                <div>
                  <div className="track-item-name">
                    {item.cropName}
                  </div>
                  <div className="track-item-meta">
                    {item.qty} × ₹{item.price}
                  </div>
                </div>
                <div>₹{item.qty * item.price}</div>
              </div>
            ))}

            {/* TOTAL */}
            <div className="track-total">
              <span>Total</span>
              <span>₹{order.total}</span>
            </div>

            {/* ACTIONS */}
            <div className="track-actions">
              <button
                className="track-btn primary"
                onClick={() => navigate("/dashboard")}
              >
                Home
              </button>
              <button
                className="track-btn secondary"
                onClick={() => navigate("/marketplace")}
              >
                Shop More
              </button>
            </div>
          </div>
        )}
      </div>

      <Footer />
    </>
  );
}

export default TrackOrder;
